        static IEnumerable<TestCase<double, double>> GetPI2Data(Ellint3CData[] data)
        {
            return data.Select(d => TestCase.Create(d.K, d.Nu, d.Result));
        }

        static IEnumerable<TestCase<double, double, double>> GetPI3Data(Ellint3Data[] data)
        {
            return data.Select(d => TestCase.Create(d.K, d.Nu, d.Phi, d.Result));
        }

        [TestMethod]
        public void EllintPI2Test()
        {

            TestCaseSet<double, double>[] testCases = {
                new TestCaseSet<double,double>(GetPI2Data(_EllintPi2SpotData), "Elliptic Integral PI2: Mathworld Data", 15),
                new TestCaseSet<double,double>(GetPI2Data(_EllintPi2Data), "Elliptic Integral PI2: Random Data", 15) 
            };

            NumericFunctionTest.RunSet(Math2.EllintPi, "EllintPi", testCases);

        }

        [TestMethod]
        public void EllintPI3Test()
        {

            TestCaseSet<double, double, double>[] testCases = {
                new TestCaseSet<double,double, double>(GetPI3Data(_EllintPi3SpotData), "Elliptic Integral PI3: Mathworld Spot Data", 15),
                new TestCaseSet<double,double, double>(GetPI3Data(_EllintPi3Data), "Elliptic Integral PI3: Mathworld Data", 15),
                new TestCaseSet<double,double, double>(GetPI3Data(_EllintPi3LargeData), "Elliptic Integral PI3: Large Data", 50),
                new TestCaseSet<double,double, double>(GetPI3Data(_EllintPi3LargeAngleData), "Elliptic Integral PI3: Large Angle Data", 50),
            };


            NumericFunctionTest.RunSet(Math2.EllintPi, "EllintPi", testCases);

        }


